MGCAddSnippet(1, "Title Page");
MGCAddSnippet(2, "List of Figures");
MGCAddSnippet(3, "List of Tables");
MGCAddSnippet(4, "");
MGCAddSnippet(5, "Calibre Multi-Patterning products facilitate fabrication of designs below the resolution limit of exposure wavelength by splitting a design into two or more masks that can independently be imaged in the scanner.");
MGCAddSnippet(6, "Calibre Multi-Patterning decomposes layers into separate masks. Some layout topologies are not decomposable without adjustments to shapes by splitting them into sections and saving these sections to different masks (stitching).");
MGCAddSnippet(7, "Calibre Multi-Patterning decomposition is performed using colored or uncolored flows, typically by design houses and foundries, respectively.");
MGCAddSnippet(8, "Calibre Multi-Patterning decomposes designs by whole shape or stitching methods.");
MGCAddSnippet(9, "Familiarity with SVRF and TVF programming is recommended, but not required, for optimal use of Calibre Multi-Patterning.");
MGCAddSnippet(10, "The command descriptions use font properties and several metacharacters to document the command syntax.");
MGCAddSnippet(11, "The challenges of fabricating integrated circuits at sub-32 nm process nodes has necessitated several Multi-Patterning processing methods. ");
MGCAddSnippet(12, "Multi-patterning is a resolution enhancement technique (RET) that decomposes original drawn shapes of a layout into two or more separate masks to be exposed independently. ");
MGCAddSnippet(13, "LELE is the earliest double-patterning process. ");
MGCAddSnippet(14, "The LLE process consists of two exposures and a single development and etch. ");
MGCAddSnippet(15, "The LFLE process is similar to LLE with the addition of a resist-freezing step.");
MGCAddSnippet(16, "SADP uses deposited spacers around mandrel shapes to print sub-resolution features. ");
MGCAddSnippet(17, "SAQP uses two-stage deposited spacers around mandrel shapes to print sub-resolution features.");
MGCAddSnippet(18, "SVRF-based Calibre Multi-Patterning commands adhere to SVRF standards.");
MGCAddSnippet(19, "A typical SVRF rule file containing double-, triple-, and quadruple-patterning may also contain other SVRF commands that declare input layers, perform preliminary layer manipulation, and save output layers.");
MGCAddSnippet(20, "Calls the DFM SPEC BALANCE statement for each balanced mask to output.");
MGCAddSnippet(21, "Selects or generates separators or polygons based on geometric and graph-based properties of connected components.");
MGCAddSnippet(22, "Invokes Calibre double-patterning. Splits the target layer into two masks and generates error layers.");
MGCAddSnippet(23, "Provides rapid decomposition of similar polygon patterns.");
MGCAddSnippet(24, "Optimizes mask coloring through application of priority-based expressions applied to layers.");
MGCAddSnippet(25, "Generates constraint layers from DFM DP based on priority.");
MGCAddSnippet(26, "Invokes Calibre triple- or quadruple-patterning. Splits the target layer into three or four masks and generates error layers.");
MGCAddSnippet(27, "Generates a layer covering the area of selected cells based on various criteria.");
MGCAddSnippet(28, "Generates multi-pattern stitches. References DFM SPEC MPSTITCH constraint specifications.");
MGCAddSnippet(29, "Emulates RET NMDPC operations using DFM DP algorithms.");
MGCAddSnippet(30, "Specifies multi-pattern mask balancing criterion. Called by the DFM BALANCE command.");
MGCAddSnippet(31, "Specifies multi-pattern stitching values and constraints. Called by DFM MPSTITCH.");
MGCAddSnippet(32, "Executes the specified encrypted tp_model.tvf file and its arguments.");
MGCAddSnippet(33, "Executes the specified encrypted tp_separator.tvf file and its arguments.");
MGCAddSnippet(34, "Executes the specified encrypted tp_stitch_gen.tvf file and its arguments.");
MGCAddSnippet(35, "Executes the specified encrypted mp_stitch_gen.tvf file and its arguments.");
MGCAddSnippet(36, "Calls a LITHO FILE statement containing a setlayer dpstitch command that generates stitch candidate shapes. Used with RET NMDPC and DFM DP.");
MGCAddSnippet(37, "Invokes Calibre nmDPC and splits the target layer into two masks.");
MGCAddSnippet(38, "Invokes Calibre quadruple-patterning using the RET QP command. Splits the target layer into four masks and generates error layers.");
MGCAddSnippet(39, "Invokes Calibre triple-patterning using the RET TP command. Splits the target layer into three masks and generates error layers.");
MGCAddSnippet(40, "The FILE argument of RET-based commands call their respective LITHO FILE statement. The LITHO FILE statement contains application-specific commands and settings called by RET NMDPC, RET TP, and RET QP.");
MGCAddSnippet(41, "Specifies pattern decomposition commands. Used only with RET NMDPC, RET TP, and RET QP.");
MGCAddSnippet(42, "Declares layers for separators and stitches, and invokes coloring. Used for RET NMDPC only.");
MGCAddSnippet(43, "Forces decomposed shapes to be saved to a specific mask. Called by RET NMDPC, RET TP, and RET QP.");
MGCAddSnippet(44, "Disables mask balancing. Used for RET NMDPC only.");
MGCAddSnippet(45, "Allows layers to be available for the setlayer commands. Used for RET NMDPC only.");
MGCAddSnippet(46, "Passes stitching keywords with free-format to setlayer. Used for RET NMDPC and RET DPSTITCH only.");
MGCAddSnippet(47, "Causes the generated mask layers to be output. Used for RET NMDPC only.");
MGCAddSnippet(48, "Disables alternating coloring for non-separated target shapes. Used for RET NMDPC only.");
MGCAddSnippet(49, "Generates layers for dpStitchCandidates. Used for RET DPSTITCH only.");
MGCAddSnippet(50, "Declares the input target layer. Used for RET TP and RET QP only.");
MGCAddSnippet(51, "Specifies the size of a processing tile. Used for RET NMDPC and RET DPSTITCH only.");
MGCAddSnippet(52, "The setlayer dpstitch options block contains keywords that classify edges and specify dimensional constraints. The options block is referenced by the OPTION argument of a setlayer dpstitch command. ");
MGCAddSnippet(53, "Classifies edges into groups.");
MGCAddSnippet(54, "Accumulates various user-defined face classes into a single set.");
MGCAddSnippet(55, "Specifies the minimum width of stitch candidates.");
MGCAddSnippet(56, "Specifies spacing requirements between two face classes.");
MGCAddSnippet(57, "Generates shapes representing regions where overlapping decomposed layers may be joined.");
MGCAddSnippet(58, "Specifies stitch length requirements for various line widths.");
MGCAddSnippet(59, "Defines the minimum distance from every outside corner to a stitch candidate rectangle.");
MGCAddSnippet(60, "Specifies the required conditions that make an intersection suitable for stitches.");
MGCAddSnippet(61, "Defines the minimum overlap required for concave corners to receive stitches.");
MGCAddSnippet(62, "Specifies the minimum length of an intersection extension that is considered for stitching.");
MGCAddSnippet(63, "Specifies the spacing from vias to stitches.");
MGCAddSnippet(64, "Defines the minimum distance from every inside corner to a stitch candidate rectangle.");
MGCAddSnippet(65, "Declares the version of the LITHO FILE statement.");
MGCAddSnippet(66, "RET SIDCUTFILL is the Calibre command developed to support SADP and SAQP methodologies using the sidewall-is-dielectric (SID) process.");
MGCAddSnippet(67, "The Calibre RET SIDCUTFILL command and its associated keywords generate topologies to adhere to Spacer Is Dielectric (SID) processes for Self-Aligned Double-Patterning (SADP). These commands address track generation and coloring, cut generation, track termination, track layout, and output error layers to help resolve SADP-related issues during SADP topology generation.");
MGCAddSnippet(68, "The RET SIDCUTFILL command generates mandrel and non-mandrel tracks, and cuts to build design topologies satisfying the SID Cut-Fill process.");
MGCAddSnippet(69, "Cuts provide termination for correct track connectivity.");
MGCAddSnippet(70, "Removes mandrel and non-mandrel dummy fill.");
MGCAddSnippet(71, "Provides patterns for target derivation.");
MGCAddSnippet(72, "Various error layers help resolve SADP patterning problems quickly.");
MGCAddSnippet(73, "Operational modes enable control over cut placement, cut length, and track generation.");
MGCAddSnippet(74, "The Calibre RET SIDCUTFILL command and associated keywords are an implementation of the spacer-is-dielectric (SID) process for Self-Aligned Double-Patterning (SADP). These commands address topological generation requirements for the SID process. Calibre SADP-specific commands adhere to SVRF standards. A typical SVRF rule file containing SADP-specific commands may also contain other SVRF commands that specify input layers, perform preliminary layer manipulation, and save output layers.");
MGCAddSnippet(75, "Calibre RET SIDCUTFILL builds a correct-by-design topology of tracks and cuts, adhering to the spacer-is-dielectric process, and complies to all specified SADP-based design rules. Calibre SADP-specific commands adhere to SVRF standards. A typical SVRF rule file containing SADP-specific commands may also contain other SVRF commands that specify input layers, perform preliminary layer manipulation, and save output layers.");
MGCAddSnippet(76, "Parameters specified within the LITHO FILE statement include designated layer order, and numeric values or variables used by RET SIDCUTFILL. The LITHO FILE statement may be written anywhere within the SVRF file. Parameters are specified one per line in the LITHO FILE statement.");
MGCAddSnippet(77, "SADP-specific cut spacing parameters are written within the LITHO FILE statement and referenced by the RET SIDCUTFILL command.");
MGCAddSnippet(78, "Classifies cut edges into a named group.");
MGCAddSnippet(79, "Accumulates various user-defined cut face classes into a single set.");
MGCAddSnippet(80, "Specifies spacing requirements between two face classes for SADP.");
MGCAddSnippet(81, "You use Calibre Multi-Patterning to perform mask decomposition. Because Calibre Multi-Patterning tools run in batch mode, you configure all settings in a LITHO FILE statement, which is called from an SVRF file.");
MGCAddSnippet(82, "Invokes the SVRF-based Multi-Patterning command set.");
MGCAddSnippet(83, "Whole-shape layer decomposition is performed using Calibre nmDPC. You control whether specific sets of shapes go onto same or different masks, or allow Calibre to automatically place them. ");
MGCAddSnippet(84, "Stitching shapes is performed by Calibre nmDPC. Valid stitch areas can be determined manually or automatically using RET DPSTITCH. RET DPSTITCH calls the LITHO FILE statement and outputs a stitch candidates layer. RET NMDPC then inputs the stitch candidates layer to produce final stitches.");
MGCAddSnippet(85, "The anchor0 and anchor1 keywords assign target shapes to either mask0 or mask1. They are properly assigned to either mask when they touch, overlap, or enclose the anchor shapes. Anchor assignment is flexible and suitable for many process types.");
MGCAddSnippet(86, "The NMDPC command invokes stitch candidate decomposition using the action stitch keyword in the LITHO FILE statement.");
MGCAddSnippet(87, "User-drawn stitches can be helpful for controlling NMDPC.");
MGCAddSnippet(88, "Pre-colored stitches established with anchors retain predetermined colors for cell library and third-party IP for NMDPC.");
MGCAddSnippet(89, "You can develop your own stitches that are input to NMDPC.");
MGCAddSnippet(90, "Auto-generation of stitches using DPSTITCH is the least SVRF-intensive method.");
MGCAddSnippet(91, "Calibre Multi-Patterning provides checks and operations during execution of dpStitch that ensure stitches adhere to the design assumptions described in this section. When generating stitches with methods other than dpStitch, you are responsible for ensuring adherence to these assumptions.");
MGCAddSnippet(92, "Even though stitches may be user-drawn or generated by dpStitchCandidates, they are still considered candidates until appropriated by the accompanying priority and mask-specific settings. Generated stitches are dependent on these settings.");
MGCAddSnippet(93, "Priority and mask settings specified for individual action stitch commands produce significant interactions between auto-stitches, user stitches and separators. ");
MGCAddSnippet(94, "When the LITHO FILE statement is contained within the SVRF file, you can use variables set in the main SVRF level within the LITHO FILE statement. ");
MGCAddSnippet(95, "Debugging double-patterning errors is simplified with the Calibre RVE. MAP keywords in the SVRF rules file provide visual debugging for double‑patterning errors resulting from non-conforming layout topologies.");
MGCAddSnippet(96, "After running Calibre double-patterning, you find DP-related errors revealed by the MAP keywords specified in the RET NMDPC command. ");
MGCAddSnippet(97, "Edit a layout to resolve errors found by Calibre DP error types.");
MGCAddSnippet(98, "Visualization keywords assist the user to resolve multi-patterning-related decomposition failures. Three classes of visualization keywords are supported for various decomposition errors.");
MGCAddSnippet(99, "Use example rule files to help speed your file development.");
MGCAddSnippet(100, "The action keyword is used for whole shape decomposition. The action keyword processes layers containing polygon or edge-pair separators. These layers can then be derived with SVRF preceding the RET NMDPC command. ");
MGCAddSnippet(101, "The dpStitchCandidates command generates stitches over regions of overlapping shapes on previously decomposed masks.");
MGCAddSnippet(102, "Best practices expedite Calibre Multi-Patterning recipe development. ");
MGCAddSnippet(103, "Separators and the action command handle edges or polygons differently. ");
MGCAddSnippet(104, "Separator and action layers are used to convey color relationships between one or more polygons and require careful assignment.");
MGCAddSnippet(105, "The selection of tile size is critical for optimum processing. ");
MGCAddSnippet(106, "Best practices result in better processing performance for Calibre Multi-Patterning.");
MGCAddSnippet(107, "");
MGCAddSnippet(108, "Details on open source and third-party software that may be included with this product are available in the <your_software_installation_location>/legal directory.");

